/**
 * https://leetcode-cn.com/problems/maximum-score-of-a-good-subarray/
 */

class Solution {
    func maximumScore(_ nums: [Int], _ k: Int) -> Int {
        print("--------\nstart with nums = \(nums), \nk = \(k), nums[k] = \(nums[k])")
        if (nums.count == 1) {
            return nums[0]
        }

        var min = nums[0]
        var pos = 0
        for (index, num) in nums.enumerated() {
            if num < min {
                min = num
                pos = index
            }
        }
        var res = min * nums.count 
        print("min = \(min), res = \(res)")
        if pos > 0 && pos > k {
            print("left = (\(nums.startIndex) ..< \(pos) )")
            let lNums = Array(nums[nums.startIndex ..< pos])
            let l = maximumScore(lNums, k)
            if res > l {
                print("ans arr = \(nums)")
            }
            res = max(res, l)
        }
        if pos < nums.count - 1 && pos < k {
            print("right = (\(pos) ..< \(nums.endIndex))")
            let rNums = Array(nums[pos+1 ..< nums.endIndex])
            let r = maximumScore(rNums, k-pos-1)
            if res > r {
                print("ans arr = \(nums)")
            }
            res = max(res, r)
        }
        return res        
    }
}

